import React from "react";
import { StyleSheet, View, ImageBackground, Text, Image } from "react-native";
import { ScrollView, TouchableOpacity } from "react-native-gesture-handler";
import PageSubitle from "./PageSubtitle";
import BtnRetour from "../component/BtnRetour";
import { useFonts } from "expo-font";
import IconProfil from "../component/IconProfil";
import PageTitle from "../component/PageTitle";

export default function PodcastsPage({ navigation }) {
  const date = "25 janvier à 15h";
  const resume = "";
  const [loaded] = useFonts({
    CormorantGaramond: require("../assets/font/CormorantGaramond-Bold.ttf"),
  });

  if (!loaded) {
    return null;
  }

  return (
    <View style={styles.container}>
      <ImageBackground
        source={require("../assets/images/fond_noir.png")}
        style={styles.fondNoir}
      >
        <IconProfil navigation={navigation} />
        <PageTitle content={"Mon coach"} />
        <BtnRetour navigation={navigation} />
        <View style={styles.contour}>
          <View style={styles.interieur}>
            <Text
              style={{
                color: "white",
                marginBottom: 10,
              }}
            >
              RDV COACH
            </Text>
            <Text style={{ color: "white", fontWeight: "bold" }}>{date}</Text>
          </View>
        </View>
        <Text style={styles.description}>
          Merci d'avoir souscris à l'offre de coaching {"\n\n"}Vous retrouverez
          ici le récapitulatif de vos rendez-vous réalisés avec votre coach.
        </Text>
        <PageSubitle content="Le récapitulatif de vos précédentes séances" />
        <View style={styles.resume}>
          {resume !== "" ? (
            <Text>{resume}</Text>
          ) : (
            <Text style={{ fontWeight: "bold" }}>
              Le résumé de vos séances arrive !{" "}
            </Text>
          )}
        </View>
      </ImageBackground>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    justifyContent: "center",
    width: "100%",
    height: "100%",
  },
  item: {
    textAlign: "center",
    padding: 10,
    fontSize: 78,
  },
  fondNoir: {
    resizeMode: "cover",
    height: "100%",
    justifyContent: "center",
    alignItems: "center",
  },
  contour: {
    borderTopColor: "black",
    borderBottomColor: "black",
    borderTopWidth: 1,
    borderBottomWidth: 1,
    width: "80%",
    height: "11%",
    justifyContent: "center",
    alignItems: "center",
    marginBottom: 50,
    marginTop: "35%",
  },
  interieur: {
    width: "90%",
    height: "90%",
    backgroundColor: "#BD7B49",
    borderRadius: 5,
    alignItems: "center",
    justifyContent: "center",
  },
  description: {
    width: "80%",
    textAlign: "center",
    marginBottom: 30,
  },
  resume: {
    width: "80%",
    height: 250,
    backgroundColor: "#d1bdb1",
    borderRadius: 5,
    justifyContent: "center",
    alignItems: "center",
  },
});
